import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import {
  UserList,
  SingleUser
} from "./User";
import LoginForm from "./auth";

export default function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/userlist">UserList</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/userlist/:id" component={SingleUser}/>
          <Route path="/userlogin">
            <LoginForm />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}


function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

const users = [
    {id: 1, username: "admin", first_name: 'Else', last_name: 'Form', email: "gforc@adm.com"},
    {id: 2, username: "User", first_name: 'noname', last_name: 'strange', email: "mal@mail.ru"},
]
